window.bookSummaryJSON = "<p>The death of his wife four years earlier left Travis Bennett a shell of the man he used to be. With his dog by his side, Travis raises his three children, manages his business, and works as a ranch hand. But every day, every minute, is an aching emptiness. </p> <p>Wesley Ryan has fond memories of the small Ozark town of El Dorado Springs. Seeing it as a safe place to put his failed relationships behind him, Wesley moves into his grandparents' old home and takes over the local veterinary clinic. An early morning visit from Travis and his dog stirs feelings that Wesley seeks to push away - the last thing he needs is to fall for a man with baggage and three kids as part of the package. </p> <p>Life, it seems, has other plans. </p>"; 
